import React from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Paper from '@mui/material/Paper';
import AddIcon from '@mui/icons-material/Add'

function App() {
  return (
    <Paper elevation={5} sx={{width: "auto",display: 'flex', alignItems: 'center', justifyContent: 'center', padding: '2%'}}>
      <Stack spacing={3} direction="row" >
        <TextField
              id="outlined-number"
              label="Number"
              type="number"
              slotProps={{
                inputLabel: {
                  shrink: true,
                },
              }}
              sx={{width: '25%'}}
          />
        <AddIcon />
        <TextField
              id="outlined-number"
              label="Number"
              type="number"
              slotProps={{
                inputLabel: {
                  shrink: true,
                },
              }}
              sx={{width: '25%'}}
          />
        <Button variant="contained" color="warning">Calculate</Button>
      </Stack>
    </Paper >
  );
}

export default App;
